/* 概率最大的路径.cpp : 此文件包含 "main" 函数。程序执行将在此处开始并结束。
给你一个由 n 个节点（下标从 0 开始）组成的无向加权图，该图由一个描述边的列表组成，其中 edges[i] = [a, b] 表示连接节点 a 和 b 的一条无向边，且该边遍历成功的概率为 succProb[i] 。

指定两个节点分别作为起点 start 和终点 end ，请你找出从起点到终点成功概率最大的路径，并返回其成功概率。

如果不存在从 start 到 end 的路径，请 返回 0 。只要答案与标准答案的误差不超过 1e-5 ，就会被视作正确答案。

 

示例 1：



输入：n = 3, edges = [[0,1],[1,2],[0,2]], succProb = [0.5,0.5,0.2], start = 0, end = 2
输出：0.25000
解释：从起点到终点有两条路径，其中一条的成功概率为 0.2 ，而另一条为 0.5 * 0.5 = 0.25
示例 2：



输入：n = 3, edges = [[0,1],[1,2],[0,2]], succProb = [0.5,0.5,0.3], start = 0, end = 2
输出：0.30000
示例 3：



输入：n = 3, edges = [[0,1]], succProb = [0.5], start = 0, end = 2
输出：0.00000
解释：节点 0 和 节点 2 之间不存在路径
 

提示：

2 <= n <= 10^4
0 <= start, end < n
start != end
0 <= a, b < n
a != b
0 <= succProb.length == edges.length <= 2*10^4
0 <= succProb[i] <= 1
每两个节点之间最多有一条边

来源：力扣（LeetCode）
链接：https://leetcode-cn.com/problems/path-with-maximum-probability
著作权归领扣网络所有。商业转载请联系官方授权，非商业转载请注明出处。
*/

#include <iostream>
#include <queue>
#include "../check/CheckResult.h"

using namespace std;

class Solution {
public:
    double maxProbability(int n, vector<vector<int>>& edges, vector<double>& succProb, int start, int end) {
        vector<vector<pair<double, int>>> adjacencies(n);
        getAdjacencies(edges, succProb, adjacencies);

        vector<double> maxProbability(n, 0);  // 从start到其它node的probability
        maxProbability[start] = 1;

        dijkstra(start, adjacencies, maxProbability);

        return maxProbability[end];
    }

    void getAdjacencies(vector<vector<int>>& edges, vector<double>& succProb, vector<vector<pair<double, int>>>& adjacencies) {
        int index = 0;

        for (auto& edge : edges) {
            adjacencies[edge[0]].push_back({ succProb[index], edge[1]});
            adjacencies[edge[1]].push_back({ succProb[index++], edge[0] });
        }
    }

    void dijkstra(int start, vector<vector<pair<double, int>>>& adjacencies, vector<double>& maxProbability) {
        priority_queue<pair<double, int>> nodes;  // 使用优先队列，每次选出概率最大的点拓展下一个
        nodes.push({ 1, start });

        while (!nodes.empty()) {
            pair<double, int> node = nodes.top();
            nodes.pop();

            for (auto& peer : adjacencies[node.second]) {
                double probability = node.first * peer.first;

                if (probability > maxProbability[peer.second]) {
                    maxProbability[peer.second] = probability;
                    nodes.push({ probability, peer.second });
                }
            }
        }
    }
};

